hwt.bodyText:
If(arAddr._eq(0x0),
    bus_r_data(decoded_id_reg_din),
).Elif(arAddr._eq(0x4),
    bus_r_data(decoded_cmd_and_status_din),
).Elif(arAddr._eq(0x8),
    bus_r_data(decoded_addr_din),
).Elif(arAddr._eq(0xc),
    bus_r_data(Concat(Bits(26).fromPy(0x0, vldMask=0x0), decoded_ar_aw_w_id_din)),
).Elif(arAddr._eq(0x10),
    bus_r_data(Concat(Bits(30).fromPy(0x0, vldMask=0x0), decoded_burst_din)),
).Elif(arAddr._eq(0x14),
    bus_r_data(Concat(Bits(28).fromPy(0x0, vldMask=0x0), decoded_cache_din)),
).Elif(arAddr._eq(0x18),
    bus_r_data(Concat(Bits(24).fromPy(0x0, vldMask=0x0), decoded_len_din)),
).Elif(arAddr._eq(0x1c),
    bus_r_data(Concat(Bits(31).fromPy(0x0, vldMask=0x0), decoded_lock_din)),
).Elif(arAddr._eq(0x20),
    bus_r_data(Concat(Bits(29).fromPy(0x0, vldMask=0x0), decoded_prot_din)),
).Elif(arAddr._eq(0x24),
    bus_r_data(Concat(Bits(29).fromPy(0x0, vldMask=0x0), decoded_size_din)),
).Elif(arAddr._eq(0x28),
    bus_r_data(Concat(Bits(28).fromPy(0x0, vldMask=0x0), decoded_qos_din)),
).Elif(arAddr._eq(0x2c),
    bus_r_data(Concat(Bits(26).fromPy(0x0, vldMask=0x0), decoded_r_id_din)),
).Elif(arAddr._eq(0x30),
    bus_r_data(decoded_r_data_din),
).Elif(arAddr._eq(0x34),
    bus_r_data(Concat(Bits(30).fromPy(0x0, vldMask=0x0), decoded_r_resp_din)),
).Elif(arAddr._eq(0x38),
    bus_r_data(Concat(Bits(31).fromPy(0x0, vldMask=0x0), decoded_r_last_din)),
).Elif(arAddr._eq(0x3c),
    bus_r_data(Concat(Bits(26).fromPy(0x0, vldMask=0x0), decoded_b_id_din)),
).Elif(arAddr._eq(0x40),
    bus_r_data(Concat(Bits(30).fromPy(0x0, vldMask=0x0), decoded_b_resp_din)),
).Elif(arAddr._eq(0x44),
    bus_r_data(decoded_w_data_din),
).Elif(arAddr._eq(0x48),
    bus_r_data(Concat(Bits(31).fromPy(0x0, vldMask=0x0), decoded_w_last_din)),
).Elif(arAddr._eq(0x4c),
    bus_r_data(Concat(Bits(24).fromPy(0x0, vldMask=0x0), decoded_w_strb_din)),
).Elif(arAddr._eq(0x50),
    bus_r_data(Concat(Bits(22).fromPy(0x0, vldMask=0x0), decoded_hs_din)),
).Else(
    bus_r_data(None),
)

If(rSt._eq(rSt_t.rdIdle),
    If(bus_ar_valid & (~isBramAddr) & (~w_hs),
        rSt_next(rSt_t.rdData),
    ).Elif(bus_ar_valid & isBramAddr & (~w_hs),
        rSt_next(rSt_t.bramRd),
    ).Else(
        rSt_next(rSt),
    ),
).Elif(rSt._eq(rSt_t.bramRd),
    If(~w_hs,
        rSt_next(rSt_t.rdData),
    ).Else(
        rSt_next(rSt),
    ),
).Else(
    If(bus_r_ready,
        rSt_next(rSt_t.rdIdle),
    ).Else(
        rSt_next(rSt),
    ),
)

If(wSt._eq(wSt_t.wrIdle),
    If(bus_aw_valid,
        wSt_next(wSt_t.wrData),
    ).Else(
        wSt_next(wSt),
    ),
).Elif(wSt._eq(wSt_t.wrData),
    If(bus_w_valid,
        wSt_next(wSt_t.wrResp),
    ).Else(
        wSt_next(wSt),
    ),
).Else(
    If(bus_b_ready,
        wSt_next(wSt_t.wrIdle),
    ).Else(
        wSt_next(wSt),
    ),
)

If((clk)._onRisingEdge(),
    If(rst_n._eq(0x0),
        wSt(wSt_t.wrIdle),
        rSt(rSt_t.rdIdle),
    ).Else(
        wSt(wSt_next),
        rSt(rSt_next),
    ),
)

If(st._eq(state_t.ready),
    If((reg_cmd_vld._eq(0x1)) & (reg_cmd._eq(0x1)),
        st_next(state_t.wait_aw),
    ).Elif((reg_cmd_vld._eq(0x1)) & (reg_cmd._eq(0x4)),
        st_next(state_t.wait_ar),
    ).Elif((reg_cmd_vld._eq(0x1)) & (reg_cmd._eq(0x2)),
        st_next(state_t.wait_w),
    ).Elif((reg_cmd_vld._eq(0x1)) & (reg_cmd._eq(0x5)),
        st_next(state_t.wait_r),
    ).Elif((reg_cmd_vld._eq(0x1)) & (reg_cmd._eq(0x3)),
        st_next(state_t.wait_b),
    ).Else(
        st_next(st),
    ),
).Elif(st._eq(state_t.wait_aw),
    If(m_axi_aw_ready,
        st_next(state_t.ready),
    ).Else(
        st_next(st),
    ),
).Elif(st._eq(state_t.wait_ar),
    If(m_axi_ar_ready,
        st_next(state_t.ready),
    ).Else(
        st_next(st),
    ),
).Elif(st._eq(state_t.wait_w),
    If(m_axi_w_ready,
        st_next(state_t.ready),
    ).Else(
        st_next(st),
    ),
).Elif(st._eq(state_t.wait_r),
    If(m_axi_r_valid,
        st_next(state_t.ready),
    ).Else(
        st_next(st),
    ),
).Else(
    If(m_axi_b_valid,
        st_next(state_t.ready),
    ).Else(
        st_next(st),
    ),
)
